DROP TABLE IF EXISTS `route`;

CREATE TABLE `route` (
  `route_id` bigint(20) DEFAULT NULL,
  `route_name` varchar(64) DEFAULT NULL,
  `opposite_id` bigint(20) DEFAULT NULL
);



DROP TABLE IF EXISTS `stop`;

CREATE TABLE `stop` (
  `sid` int(11) NOT NULL,
  `stop_id` bigint(20) DEFAULT NULL,
  `stop_name` varchar(64) DEFAULT NULL
);



